descr:
Fica a pessoa jurídica supracitada notificada da entrega dos laudos laboratoriais de análise de orientação nos:
1. laudo de análise 225.1P.0/2020 (termo de coleta 8431 de 10/02/2020, com resultado insatisfatório);
2. laudo de análise 226.1.P.0/2020 (termo de coleta 8432 de 10/02/2020, com resultado satisfatório);
3. laudo de análise 227.1P.0/2020 (termo de coleta 8433 de 10/02/2020, com resutado insatisfatporio);
4. laudo de análise 228.1P.0/2020 (termo de coleta 8434 de 10/02/2020, com resutado insatisfatporio);
5. laudo de análise 229.1P.0/2020 (termo de coleta 8435 de 10/02/2020, com resutado satisfatporio);
6. laudo de análise 230.1P.0/2020 (termo de coleta 8436 de 10/02/2020, com resutado satisfatporio).
As análises de orientação foram realizadas como parte do processo de monitoramento da qualidade sanitária de alimentos.
